import React from "react";

export default function Type1() {
  return (
    <section className="type">
      <div className="type-container">
        <iframe className="type-container__player">
          src="https://open.spotify.com/embed/playlist/2Uxq7XTEcoU3p9MAXiS74c"
          width="300" height="380" frameborder="0" allowtransparency="true"
          allow="encrypted-media" >
        </iframe>
         <iframe src="https://open.spotify.com/embed?uri=spotify:artist:2SdcyCKXwjtQJymVLGyBlx&theme=white" width="250" height="330" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
      </div>
    </section>
  );
}
